namespace CameraSystem 
{
    public class SurveillanceManager
    {
        public Camera[] Cameras { get; set; }

        // /// constructor to setup Cameras
        public SurveillanceManager(Camera[] cameras)
        {
            this.Cameras = cameras;
        }

        ///// online event handler 
        private void OnCameraOnline(object sender, EventArgs e)
        {
            Camera camera = sender as Camera;
            if (camera != null)
            {
                Console.WriteLine("Camera '{0}' is now online.", camera.Name);
            }
        }

        ///// offline event handler 
        private void OnCameraOffline(object sender, EventArgs e)
        {
            Camera camera = sender as Camera;
            if (camera != null)
            {
                Console.WriteLine("Camera '{0}' is now offline.", camera.Name);
            }
        }

        ///// start monitoring
        public void StartSurveillance()
        {
            Console.WriteLine("Monitoring started!");

            foreach (Camera camera in Cameras)
            {
                if (camera != null)
                {
                    camera.Online += OnCameraOnline;
                    camera.Offline += OnCameraOffline;
                }
            }
        }

        ///// stop monitoring
        public void StopSurveillance()
        {
            foreach (Camera camera in Cameras)
            {
                if (camera != null) 
                {
                    camera.Online -= OnCameraOnline;
                    camera.Offline -= OnCameraOffline;
                }
            }

            Console.WriteLine("Monitoring stopped!");
        }
    }

    public class Camera
    {
        public string Name { get; set; }

        public event EventHandler Online;
        public event EventHandler Offline;

        public Camera(string name, bool isOnline)
        {
            this.Name = name;
            if (isOnline)
            {
                OnConnected();
            }
            else
            {
                OnDisconnected();
            }

        }

        public void OnConnected() 
        {
            if (Online != null) 
            {
                Online(this, EventArgs.Empty);
            }
        }

        public void OnDisconnected()
        {
            if (Offline != null) 
            {
                Offline(this, EventArgs.Empty);
            }
        }
    }
}

